def fib(n):
    if n == 0:
        return 0
    elif n == 1:
        return 1
    return fib(n-1) + fib(n-2)

def fibDP(n):
    mem = [[0] * (n + 1) for _ in range(n + 1)]
    mem[0][0] = 1
    mem[0][1] = 1
    mem[1][0] = 1
    mem[1][1] = 1
    for i in range(2, n + 1):
        for j in range(i):
            mem[i][j] = mem[i - 1][j] + mem[i - 1][j - 1]
    return mem[n][n]

